import React from "react";

import "./AboutPage.css";
import ContentHeading from "../../shared/Heading/ContentHeading";

const AboutPage = () => {
    return (
        <React.Fragment>
            <ContentHeading className="heading-container">
                About Me
            </ContentHeading>
            
        </React.Fragment>
    );
};

export default AboutPage;
